import React from 'react';
import { ButtonGroup, Button } from 'reactstrap';

const SortSelector = ({ setSortStrategy }) => {
  return (
    <ButtonGroup>
      <Button onClick={() => setSortStrategy(0)}>Bubble Sort</Button>
      <Button onClick={() => setSortStrategy(1)}>LINQ Sort</Button>
    </ButtonGroup>
  );
};

export default SortSelector;
